import React, { Component } from 'react';
import CheckInMenu from './CheckInMenu';
import { PARK_LOCATIONS } from '../../constants';
import { viewPlace } from '../../actions/checkIn';
import PlaceViewer from './PlaceViewer';
import './styles.css';

class CheckIn extends Component {

  state = {
    user: this.props.activeUser,
    locationViewed: undefined
  };


  render() {
    return (
      <div id="PageWrapper">
        <div className="windowWrapper">
          <CheckInMenu 
            options={PARK_LOCATIONS}
            onSubmitHandler={(location)=>{viewPlace(this, location)}}
          />
          {this.state.locationViewed !== undefined ?  <div id="RightWrapper "> <hr> </hr><PlaceViewer location={this.state.locationViewed} />  </div>: '' }
        </div>


      </div>
    );
  }
}

export default CheckIn;
